using System.Collections;
using System.Collections.Generic;
using System.Linq;

// AIのデータベース&取得
public class AI_Database{
	// 歴代の優勝AIのPlan内設定の行を重複なくリストにして取得する
	public List<int[]> GetPlanSettingCodeRowList(){
		Player[] players = new Player[]{new Player(),new Player(),new Player(),new Player(),new Player(),new Player(),new Player(),new Player(),new Player(),new Player()};
		List<int[]> tmp_list = new List<int[]>(){};
		for(int i=0; i<players.Length; i++){
			players[i].SetData(GetUnits(GetName(i)), GetCodes(GetName(i)));
			AddPlanSettingCodeRow(tmp_list, players[i]);
		}
		return tmp_list;
	}

	// PlayerデータからPlan内の行を取得。同じ成分がなければ追加する
	public void AddPlanSettingCodeRow(List<int[]> _list, Player _player){
		for(int i=0; i<_player.plans.Length; i++){
			for(int plan_num=0; plan_num<6; plan_num++){
				for(int j=0; j<5; j++){
					int[] tmp_array = _player.plans[i].GetPlan(plan_num).elements.GetRow(j);
					bool IsContain = false;
					foreach(int[] _array in _list){
						if(tmp_array.SequenceEqual(_array)){
							IsContain = true;
							break;
						}
					}
					if(!IsContain){
						_list.Add(tmp_array);
					}
				}
			}
		}
	}

    // 歴代の優勝AIのPlan移動設定を重複なくリストにして取得する
    public List<int[]> GetTransitionsCodeRowList()
    {
        Player[] players = new Player[] { new Player(), new Player(), new Player(), new Player(), new Player(), new Player(), new Player(), new Player(), new Player(), new Player() };
        List<int[]> tmp_list = new List<int[]>() { };
        for (int i = 0; i < players.Length; i++)
        {
            players[i].SetData(GetUnits(GetName(i)), GetCodes(GetName(i)));
            AddTransitionsCodeRow(tmp_list, players[i]);
        }
        return tmp_list;
    }

    // PlayerデータからPlan内の行を取得。同じ成分がなければ追加する
    public void AddTransitionsCodeRow(List<int[]> _list, Player _player)
    {
        for (int i = 0; i < _player.plans.Length; i++)
        {
            for (int plan_num = 0; plan_num < 6; plan_num++)
            {
                for (int j = 0; j < 5; j++)
                {
                    int[] tmp_array = _player.plans[i].GetPlan(plan_num).transitions.GetRow(j);
                    bool IsContain = false;
                    foreach (int[] _array in _list)
                    {
                        if (tmp_array.SequenceEqual(_array))
                        {
                            IsContain = true;
                            break;
                        }
                    }
                    if (!IsContain)
                    {
                        _list.Add(tmp_array);
                    }
                }
            }
        }
    }

	// 与えられたリストをコンソールに表示する（これを使って行のリストをローカルに用意できる：現状いらない）
	public string GetConsoleLogCodeArray(List<int[]> _list){
		string console_log = "{";
		foreach(int[] _array in _list){
			console_log += "{";
			for(int i=0; i<_array.Length; i++){
				console_log += _array[i];
				if(i<_array.Length-1){
					console_log += ",";
				}
			}
			console_log += "},";
		}
		console_log += "}";
		return console_log;
	}

	// for文で回す時に便利
	public string GetName(int _number){
		switch(_number){
			case 0:
			return "第0回(son59)";
			case 1:
			return "第1回(2ne)";
			case 2:
			return "第2回(nota3)";
			case 3:
			return "第3回(2ne)";
			case 4:
			return "第4回(2ne)";
			case 5:
			return "第5回(tokyo)";
			case 6:
			return "第6回(tokyo)";
			case 7:
			return "第7回(fred)";
			case 8:
			return "第1回団体 先鋒\nfred";
			case 9:
			return "第1回団体 次鋒\nfred";
			case 10:
			return "2ne";
			default:
			return "第7回(fred)";
		}
	}
	// ユニットの種類 キング:0，クイーン:18,9，ナイト:2,5,7，ビショップ:3,4,6，ポーン:10,11,12，ルーク:13,14,15
	public int[] GetUnits(string _name){	
		switch(_name){
			case "第0回(son59)":
			return new int[4]{0,2,5,7};
			case "第1回(2ne)":
			return new int[4]{0,1,2,5};
			case "第2回(nota3)":
			return new int[4]{0,1,4,2};
			case "第3回(2ne)":
			return new int[4]{0,2,4,9};
			case "第4回(2ne)":
			return new int[4]{0,1,4,2};
			case "第5回(tokyo)":
			return new int[4]{0,11,5,7};
			case "第6回(tokyo)":
			return new int[4]{0,11,5,7};
			case "第7回(fred)":
			return new int[4]{0,8,14,3};
			case "第1回団体 先鋒\nfred":
			return new int[4]{0,8,13,3};
			case "第1回団体 次鋒\nfred":
			return new int[4]{0,2,13,14};
			default:
			return new int[4]{0,1,2,3};
			case "2ne":
			return new int[4]{0,7,13,14};
		}
	}

